import React from "react"

function TodoItem(props){

    return(
        
        <div className="App">
        <div className="todo">
        <input className="check" type="checkbox" checked={props.item.completed} onChange={() => console.log("Changed")}/>
        <p className="text">{props.item.text}</p>
        </div>
        </div>
    )
}

export default TodoItem
